Webspinr.Models.Element = Backbone.Model.extend({
  urlRoot: '/api/elements',

  // Overwrite proto toJSON to deeply copy attrs
  toJSON: function () {
    var json = Backbone.Model.prototype.toJSON.call(this);
    json.attrs = JSON.stringify(this.get("attrs"));
    return json;
  }
});
Webspinr.Models.Page = Backbone.Model.extend({

  urlRoot: '/api/pages',

  elements: function () {
    if (!this._elements) {
      this._elements = new Webspinr.Collections.Elements();
    }
    return this._elements;
  },

  parse: function (payload) {
    if (payload.elements) {
      this.elements().set(payload.elements);
      delete payload.elements;
    }
    return payload;
  }
});
Webspinr.Models.Site = Backbone.Model.extend({
  urlRoot: '/api/sites',

  pages: function () {
    if (!this._pages) {
      this._pages = new Webspinr.Collections.Pages();
    }
    return this._pages;
  },

  parse: function (payload) {
    if (payload.pages) {
      this.pages().set(payload.pages, { parse: true });
      delete payload.pages;
    }

    return payload;
  }
});
Webspinr.Collections.Elements = Backbone.Collection.extend({
  model: Webspinr.Models.Element
});
Webspinr.Collections.Pages = Backbone.Collection.extend({
  model: Webspinr.Models.Page
});
Webspinr.Collections.Sites = Backbone.Collection.extend({
  model: Webspinr.Models.Site,
  url: '/api/sites'
});
Webspinr.Views.EditElement = Backbone.CompositeView.extend({
  template: function (options) {
    if (this.$el.hasClass("text") && this._editing) {
      return JST["elements/text_form"](options);
    } else {
      return JST["elements/edit"](options);
    }
  },

  events: {
    "dblclick": "editElement",
    "click": "clickElement",
    "blur textarea": "saveText",
    "submit form": "saveText",
    "contextmenu": "showPropertiesMenu"
  },

  className: function (){
    return "element " + this.model.get("classes");
  },

  tagName: function () {
    return this.model.get("tag");
  },

  initialize: function () {
    this.listenTo(this.model, "sync", this.render);
  },

  showPropertiesMenu: function (e) {
    e.preventDefault();
    this.addMenu();
    $("#root").append(this._propertiesMenuView.render().$el);
    this._propertiesMenuView.$el.css({'top': e.pageY - 5, 'left': e.pageX - 5});
  },

  addMenu: function () {
    if (!this._propertiesMenuView) {
      var subview = new Webspinr.Views.ElementPropertiesMenu({
        model: this.model
      });
      this._propertiesMenuView = subview;
    }
  },

  clickElement: function (e) {
    e.preventDefault();
  },

  saveText: function (e) {
    e.preventDefault();
    var view = this;
    var data = $(e.currentTarget).serializeJSON();
    view.model.save(data, {
      success: function () {
        view._editing = false;
        view.render();
      }
    });
  },

  editText: function () {
    alert("Edit text");
  },

  editElement: function (e) {
    e.preventDefault();
    if (this.$el.hasClass("text")) {
      this._editing = true;
      this.render();
      this.$("input").focus();
    }
  },

  setAttrs: function () {
    var attrs = this.model.get("attrs");
    for (var attr in attrs) {
      if (attr === "style") {
        this.setStyle(attrs[attr]);
      } else if (attr === 'class') {
        attrs[attr].forEach(function (klass) {
          this.$el.addClass(klass);
        }.bind(this));
      } else {
        this.$el.attr(attr, attrs[attr]);
      }
    }
  },

  setStyle: function (style) {
    for(var prop in style) {
      this.$el.css(prop, style[prop]);
    }
  },

  render: function () {
    this.$el.html(this.template({ element: this.model }));
    this.setAttrs();
    // this.$el.attr("style", this.model.get("style"));
    // this.$el.attr("src", this.model.get("src"));
    this.onRender();
    this.attachSubviews();
    this.delegateEvents();
    return this;
  },

  updatePosition: function () {
    var width = this.$el.css("width");
    var height = this.$el.css("height");
    this.model.get("attrs").style.width = width;
    this.model.get("attrs").style.height = height;
    this.model.save();
  },

  updateSize: function () {
    var left = this.$el.css("left");
    var top = this.$el.css("top");
    this.model.get("attrs").style.left = left;
    this.model.get("attrs").style.top = top;
    this.model.save();
  },

  onRender: function () {
    var view = this;

    this.$el.draggable({
      stop: this.updateSize.bind(this)
    });

    if (this.model.get("tag") !== "img") {
      this.$el.resizable();
      this.$el.resizable("destroy");
      this.$el.resizable({
        autoHide: true,
        stop: this.updatePosition.bind(this)
      });
    }

    if (this.$el.hasClass("line")) {
      this.$el.resizable("option", "maxHeight", 5);
      this.$el.resizable("option", "minHeight", 5);
    }
    // Backbone.CompositeView.prototype.onRender.call(this);
  }
});
Webspinr.Views.ElementPropertiesMenu = Backbone.CompositeView.extend({
  template: JST["elements/properties_menu"],
  className: 'element-properties-menu',

  events: {
    "click .delete": "deleteElement",
    "click .color": "changeColor",
    "click .style": "changeStyle",
    "mouseleave": "remove"
  },

  deleteElement: function () {
    this.model.destroy();
  },

  changeColor: function (e) {
    $(e.currentTarget).blur();
    var color = prompt("Enter a color"); //TODO: Replace with colorpicker
    if (this.model.get("tag") === "div") {
      this.model.get("attrs").style.background = color;
    } else {
      this.model.get("attrs").style.color = color;
    }
    this.model.save();
    this.model.trigger("sync");
  },

  changeStyle: function (e) {
    $(e.currentTarget).blur();
    var style = $(e.currentTarget).data("style");
    var borderRadius = style * 10 + "px";
    this.model.get("attrs").style["border-radius"] = borderRadius;
    this.model.save();
    this.model.trigger("sync");
  },

  render: function () {
    this.$el.html(this.template());
    this.delegateEvents();
    return this;
  },

  onRender: function () {
    debugger;
  }
});
Webspinr.Views.ElementsMenu = Backbone.View.extend({
  template: JST["menus/elements"],
  className: 'elements-menu',

  initialize: function (options) {

  },

  events: {
    "click .btn": "dropFocus",
    "click .text": "createText",
    "click .box-el": "createBox",
    "click .image": "showImageMenu",
    "click .line": "createLine",
    "click .internal-link": "createInternalLink",
    "click .external-link": "createExternalLink"
  },

  dropFocus: function (e) {
    $(e.currentTarget).blur();
  },

  createText: function () {
    var element = new Webspinr.Models.Element({
      tag: "p",
      content: "Click here to enter your text...",
      page_id: this.currentPageView.model.id,
      attrs: {
        style: {
          top: "50%",
          left: "50%",
          position: "absolute"
        },
        class: [
          "text"
        ]
      }
    });
    this.currentPageView.collection.add(element);
  },

  createLine: function () {
    var element = new Webspinr.Models.Element({
      tag: "div",
      attrs: {
        style: {
          top: "50%",
          left: "50%",
          position: "absolute",
          background: "black",
          width: "1000px",
          height: "5px"
        },
        class: [
          "box",
          "line"
        ]
      },
      page_id: this.currentPageView.model.id
    });
    this.saveElement(element);
  },

  createInternalLink: function () {
    var pageName = prompt("Enter the name of the page to link to");
    var url = "/sites#/" + this.model.id + '/' + pageName;
    var element = new Webspinr.Models.Element({
      tag: "a",
      attrs: {
        style: {
          top: "50%",
          left: "50%",
          position: "absolute"
        },
        class: [
          "link text"
        ],
        href: url
      },
      content: "Link description",
      page_id: this.currentPageView.model.id
    });
    this.saveElement(element);
  },

  createExternalLink: function () {
    var url = prompt("Enter a url to link to");
    var element = new Webspinr.Models.Element({
      tag: "a",
      attrs: {
        style: {
          top: "50%",
          left: "50%",
          position: "absolute"
        },
        class: [
          "link text"
        ],
        href: url
      },
      content: "Link description",
      page_id: this.currentPageView.model.id
    });
    this.saveElement(element);
  },

  saveElement: function (element) {
    this.currentPageView.collection.add(element);
    element.save({}, {
      error: function () {
        this.currentPageView.collection.remove(element);
      }.bind(this)
    });
  },

  showImageMenu: function () {
    var imageUrl = prompt("Enter the image url");
    this.createImage(imageUrl);
  },

  createImage: function (src) {
    var element = new Webspinr.Models.Element({
      tag: "img",
      page_id: this.currentPageView.model.id,
      attrs: {
        style: {
          top: "50%",
          left: "50%",
          position: "absolute"
        },
        class: [
          "image"
        ],
        src: src
      }
    });
    this.currentPageView.collection.add(element);
    // this.saveElement();
  },

  createBox: function () {
    var element = new Webspinr.Models.Element({
      tag: "div",
      page_id: this.currentPageView.model.id,
      attrs: {
        style: {
          top: "50%",
          left: "50%",
          position: "absolute",
          width: "50px",
          height: "50px",
          background: "darksalmon"
        },
        class: [
          "box"
        ]
      }
    });
    this.currentPageView.collection.add(element);

    element.save({}, {
      error: function () {
        this.currentPageView.collection.remove(element)
      }.bind(this)
    });
  },

  render: function () {
    this.$el.html(this.template({ element: this.model }));
    this.delegateEvents();
    return this;
  }
});
